                "genre": "ドラマ",
                "synopsis": "『美女と野獣』『アラジン』のディズニーが、『ラ・ラ・ランド』のエマ・ストーンを主演に迎え、名作アニメーション『101匹わんちゃん』のヴィラン（悪役）“クルエラ”の誕生秘話を実写映画化。パンクムーブメント吹き荒れる70年代のロンドンに、デザイナーを目指す一人の少女・エステラが降り立つ。「アートを作りたい」と野望に燃えながら、一秒たりとも無駄にはできない彼女は裁縫やデザイン画の制作に必死に励み、デザイナーへの階段を駆け上がろうと過酷な日々を乗り越えながらも切磋琢磨しながら働き続ける。その姿は”ヴィラン“とは程遠い、夢と希望に溢れる若者。私たちと何ら変わりない日々を送る彼女は、このままデザイナーへの道を歩んでいくと思われたが、カリスマ的なファッションデザイナーのバロネスとの出会いがエステラの運命を大きく変えいく。そして彼女はまるで同一人物とは思えない、狂気に満ち溢れた”クルエラ“の姿へと染まっていく。夢と希望にときめくごく普通の少女は、なぜ邪悪なヴィランへと変わり果てたのか……。",
