                "synopsis": "全世界5000万DLを突破した大人気スマホRPG『Fate\/Grand Order』。ゲーム内屈指の人気エピソード、第六特異点・第七特異点が初の劇場アニメーション化。遍歴の騎士・ベディヴィエールとカルデア一行が足を踏み入れた特異点、西暦1273年のエルサレム。そこは民たちが住処を追われ、 三つの勢力が対峙する不毛の地であった。白亜の城を築き、 民を殺戮する獅子王と「円卓の騎士」を討つべく、 ベディヴィエールらは「山の民」と協力し立ち向かう。大切な仲間をも喪う死闘を終えた彼らは、 強大な力を持つ「太陽王・オジマンディアス」に同盟を持ち掛ける。しかしオジマンディアスは獅子王の計画を明かし、 自らの民を守るためにその提案を一蹴する。獅子王の真意を知り慄くベディヴィエールたちだったが、 仲間たちとともに、 その目的を阻止すべく、 聖都・キャメロットへの進撃を決意するのだった。そしてついに、 聖都決戦の日を迎える。冷酷非道に成り果てた獅子王の真の狙いとは。滅びの約束された世界で、 人類を救済する方法とは。赦されぬ罪を背負い続けたベディヴィエールの迎える結末とは……。",
