                "synopsis": "『ストライクウィッチーズ』『ガールズ＆パンツァー』などを手がける鈴木貴昭原案のオリジナルアニメーションとして2016年から開始したTV放送の劇場版となる本作。いまからおよそ100年前、プレートのずれにより、日本は多くの国土を水没によって失った。国土保全のために次々と築かれた水上都市はいつしか海上都市となり、それらを運ぶ航路の増大に伴い、海の安全を守る職業「ブルーマーメイド」が女生徒たちの憧れとなっていた。そんな「ブルーマーメイド」に憧れ、横須賀女子海洋学校に入学した岬萌乃（夏川椎菜）は航洋艦「晴風」の艦長に任命され、クラスのメンバーとともに海洋実習に参加する。艦を動かし、目的地へと向かうだけの安全な航海のはずが、彼女たちを待ち受けていたのは数々のピンチであった。教官艦からの突然の発砲、暴走する学生艦との戦闘、救難船の救護活動など、数々の困難を乗り越え、無事に陸に帰還したことで、メンバー同士の間には固い絆が結ばれたのだった。その騒動から1ヶ月後、テスト休みを満喫する晴風メンバーに新たなピンチが訪れる。それは晴風クラスが解体されるというものだった。晴風メンバーは、動揺しながらも再び一丸となって力を合わせ、クラスの解体を阻止する。そして、メンバー間の絆をより深めていくのだった。その晴風クラス解体の危機から3ヶ月、横須賀では、呉・舞鶴・佐世保を含めた全女子海洋学校の生徒が一堂に会し文化祭と体育祭を行う「競闘遊戯会」が開催され、明乃たち晴風クラスのメンバーも歓迎祭の準備に追われていた。大和・信濃・紀伊などの超大型艦のクラスも集い、様々な演し物や競技で賑わう中、その一方では彼女たちに新たなピンチが迫っていた……。",
