                "synopsis": "13歳の時から現在に至るまで、拉致されたままの横田めぐみさんの人生を縦軸に、田口八重子さんを含む拉致被害者の苦悩と闘いを、綿密な取材に基づきリアルな描写で表現し、一人の少女～女性が体験する、想像を絶する悲劇。家族の愛情と正義に立ち向かう人々の織りなすドラマ。1977年11月15日夕刻、新潟。学校のバドミントン部の練習の帰り道で一人の少女が忽然と姿を消した。横田めぐみ（以下敬称略）13歳である。拉致工作員の手によって船底に閉じ込められためぐみは助けを求めて泣き叫び、壁をかきむしり爪をはがしてしまう。北朝鮮に着いてからは「朝鮮語を覚えたら日本に帰してやる」と言う工作員の言葉を信じ、ひたすら勉強に励んだ。然し彼女が18歳になった時、その約束が嘘であったことが分かる。日本に帰してもらえないことを知った彼女は遂に精神に破綻を来たしてしまう。1970年代の同じ頃、日本各地で行方不明事件が多発していた。工作員のリーダー、シンガンシュンは暴力的に、時には甘言を弄し、日本の若者を騙し北朝鮮に拉致していた。「スパイを防止する法律のない日本は、俺たちにとって楽な仕事場さ」と笑う工作員たち。拉致被害者田口八重子、当時22歳は日本に1歳と3歳の幼子を残して拉致された。彼女は若い工作員キムヒョンヒの日本人化教育の教師として日を送っていた。次第に姉妹のように心を通わせる二人だったが、その後キムヒョンヒは大韓航空機爆破の指令を受けて実行犯となってしまった。日本ではめぐみの両親とその支援者たちの必死の署名活動が続く。一方めぐみは平壌の915病院の精神病棟にいた。ある夜彼女は両親が自分を助けに来てくれた夢を見る。だがその夢の舞台は恐ろしい強制収容所の中だった。暴動をおこし脱走を図るめぐみとその両親、そして多くの囚人たち。炎を上げて燃え上がる強制収容所。だが彼らは警備隊の銃弾になぎ倒される。然し不思議なことに母早紀江と父滋の励ましに、再び立ち上がるめぐみと囚人たち。吹雪と火の粉が舞う中を、何度撃たれても立ち上がり、日本を目指してひたすら歩き続けるめぐみたち。この夢を見てから、めぐみの中にこの国で生き抜く新たな決意が生まれる。「・・・・・そして、いつの日か必ず！」",
