		"genre": "ドキュメンタリー",
		"synopsis": "ココ・シャンネル没後50年、女性のための永遠の香り「No.5」誕生100年。第一次世界大戦後、「皆殺しの天使」とまで称されるほど19世紀的な価値観を葬り去り女性を因習から解放して、女性として史上初の世界的実業家となったシャネル。ピカソ、ストラヴィンスキー、ディアギレフ、コクトーなどの芸術家、チャーチルやウィンザー公などの政治家や王侯貴族との交流、めくるめく幾多の恋を通じて得たインスピレーションと人脈を駆使し、モードの帝国を第二次世界大戦前までに築き上げていた。ところが、ナチスドイツによるパリの占領が解けた1944年、彼女は突如としてパリを脱出しスイスへ向かう。以後、齢70歳にして劇的な復活を遂げる1957年まで、10年あまりもの長きにわたり沈黙した。なぜ？シャネル自身により、また評伝や映画などで虚実ないまぜの様々な物語が語られてきたが、それらの多くは、沈黙の謎が確証を持って暴かれる2011年以前のもの。本作は、この実証を踏まえた上で、毀誉褒貶の激しい、多面的で孤独な、しかしなんとも魅力的なシャネルの生涯と実像に迫ったドキュメンタリー。",
