		"synopsis": "戦時下の研究者の葛藤を描く青春群像劇。終戦75周年を迎えた2020年に、NHKとELEVEN ARTS Studios（USA）による日米合作作品として製作された特集ドラマ「太陽の子」。テレビドラマ版とは異なった視点で描かれる映画では、時代に翻弄された修（柳楽優弥）・世津（有村架純）・裕之（三浦春馬）それぞれの想いが交錯する。戦況が激化し、最終局面を迎えた1945年の夏。軍から密命を受けた京都帝国大学・物理学研究室で研究に勤しむ実験好きの若き科学者・石村修（柳楽優弥）と研究員たちは、「今研究しているものが完成すれば、戦争は終わる。世界を変えられる」と、託された国の未来のために情熱的に原子核爆弾の研究開発を進めていた。研究に没頭する日々が続く中、建物疎開で家を失い、修の家に住むことになった幼馴染の朝倉世津（有村架純）。時を同じく、修の弟・裕之（三浦春馬）が戦地から一時帰宅し、3人は久しぶりの再会を喜んだ。3人でのひとときの幸せな時が流れる中、戦地で裕之が負った深い心の傷を垣間見た修と世津。一方で物理学研究の楽しさに魅了されていた修も、その裏側にある破壊の恐ろしさに葛藤を抱えていた。そんな2人を力強く包み込む世津はただ一人、戦争が終わった後の世界を考え始めていた。それぞれの想いを受け止め、自分たちの未来のためと開発を急ぐ修と研究チームだが、運命の8月６日が訪れてしまう。日本中が絶望に打ちひしがれる中、それでも前を向く修が見出した新たな光とは……。",
