		"synopsis": "『こんな夜更けにバナナかよ 愛しき実話』の前田哲監督が天海祐希主演で贈るコメディ。後藤篤子（天海祐希）は、家計に無頓着な旦那・章とフリーター娘のまゆみ、大学生の勇人を息子に持つ、節約がモットーのごく普通な主婦。夫の給料と自身がパートで稼いだお金をやり繰りし、憧れのブランドバッグも我慢して、コツコツ老後の資金を貯めてきた。篤子には病気の舅と、高級ケアマンションで暮らす姑の芳乃がいた。月々のケアマンションの費用だけでも痛手だったのに、舅が亡くなり、章の妹・志津子と葬式代を誰がいくらを出すかで揉め、結局400万円近くも支払うことに。さらに、パートの契約が更新されず、篤子はクビを言い渡されてしまう。そんな中、まゆみが結婚相手を家に連れてきた。メタルのバンドマン・琢磨は見かけによらず地方実業家の御曹司で、半年後の結婚式は格式高い麻布寿園で行いたいという。しかも費用は折半で。篤子は多額の出費予定に慄きながら、なんとかまゆみを送り出した。そんな中、章から会社が倒産したという連絡が入る。夫婦揃っての失業、減り続ける老後の資金。窮地に立たされた篤子は、レンタルモップの解約、車の売却と次々に節約改革を行う。しかし、篤子の努力もむなしく、お金はどんどん出ていくばかり。これまでの生活が変化していくことを実感する篤子。そして、志津子と姑の今後に関して話している最中、篤子は思わず芳乃を引き取ると口走ってしまう。芳乃を加えて新たな生活が始まった。ところが高級和菓子屋に嫁いだ芳乃のお金の使い方は奔放で、またまた出費がかかる始末。篤子は窮地に立たされる......。",
